import { Routes, Route, Link } from "react-router-dom";

import Home from './pages/home.js';

export default function App() {
  return (
      <div className="App">
          <h1>JKASLDASKLDJAS D</h1>
          <Routes>
              <Route exact path="/" element={ <Home /> } />
          </Routes>
      </div>
  );
}
